import { Chat } from "../models/chatModel.js"
import { Messgae } from "../models/messageModel.js"
import User from "../models/userModel.js"


export async function sendMessage(req,res){
    const {chatId,content} = req.body
    

    if(!chatId || !content){
        return res.status(400).json({msg:"Invalid data passed into request"})
    }

    var newMessage = {
        sender: req.userId,
        content:content,
        chat:chatId
    }

    try{
        var message = await Messgae.create(newMessage)

        //! Chain operation
        //! Each time we populate we return a new response

        // 1. first populate we are going to return the sender object with the name and pic
        //*  "sender": 
        //* {"_id": "64291e835fd7235ea2678e7d","pic": "https://upload.wikimedia.org/wikipedia/commons/9/99/Sample_User_Icon.png"},

        // 2. 2nd populate we return the sender obj and the whole chat obj... however the chat only returns an array of the userIds 

        // 3. Thats why we have user .populate 
        
        
        message = await message.populate("sender","userName pic")

        message = await message.populate("chat")

        //This part is confusing
        //* But what is happening is that our chat has an array of userIds
        // We pass the message to the user .populate as a argument that contains the chat user Array
        //* we create a link/path to the nested array
        // We then populate the users in the chat modal by setting a path chat.users
        //* and we select what we want to return

        //TODO This is what gets returned after we populate users with the arguemnt 

        // "chat": {
        //     "_id": "642cff52ec7363024456440e",
        //     "chatName": "sender",
        //     "isGroupChat": false,
        //     "users": [
        //         {
        //             "_id": "64291e835fd7235ea2678e7d",
        //             "email": "mcshifty07@gmail.com",
        //             "pic": "https://upload.wikimedia.org/wikipedia/commons/9/99/Sample_User_Icon.png"
        //         },
        //         {
        //             "_id": "64277da1f92aaedef074e5b5",
        //             "email": "chukwagon1@gmail.com",
        //             "pic": "data:image/png;base64,"
        //         }
        //     ],
        //     "createdAt": "2023-04-05T04:55:46.899Z",
        //     "updatedAt": "2023-04-08T15:06:53.910Z",
        //     "__v": 0,
        //     "latestMessage": "6431830d8c04d989fa56455d"
        // },
          message = await User.populate(message,{
              path:"chat.users",
              select:"userName pic email"
          })

           await Chat.findByIdAndUpdate(chatId,{
               latestMessage: message,
           })

        res.json(message)

    }catch(e){
        console.log(e)
        res.status(400).json({msg:e.message})
    }
}

export async function allMessages(req,res){
    
    try{
        const messages = await Messgae.find({chat: req.params.chatId}).populate("sender", "userName pic email").populate("chat")

        res.json(messages)

    }catch(e){
        console.log(e)
        res.status(400).json({msg:e.message})
    }
}